import React from 'react';
import { Dropdown, Space } from 'antd';

const items = [
  {
    key: '1',
    label: (
      <a target="_blank" rel="noopener noreferrer" href="https://www.antgroup.com">
        Выйти
      </a>
    ),
  }
];

const Menu = () => (
  <Dropdown overlay={{ items }}>
    <a onClick={(e) => e.preventDefault()}>
      <Space>
        Личный кабинет
      </Space>
    </a>
  </Dropdown>
);

export default Menu;
